import React from 'react'
import { validarSoloLetras, validarCampo, validarSoloNumeros, validarCedulaInput } from '../scripts/validacion';
import '../styles/registerStyle.css';

const FormCliente = (props) => {
    const [nombre, setNombre] = useState(props.nombreCli || '');
    const [apellido, setApellido] = useState(props.apellidoCli || '');
    const [fechaNacimiento, setFechaNacimiento] = useState(props.fechaNacimientoCli || '');
    const [celular, setCelular] = useState(props.celularCli || '');
    const [email, setEmail] = useState(props.emailCli || '');
    const [password, setPassword] = useState(props.passwordCli || '');
    const [esAdmin, setEsAdmin] = useState(props.esAdminCli || false);
    const [domicilio, setDomicilio] = useState(props.domicilioCli || '');
    const [cedula, setCedula] = useState(props.cedulaCli || '');

    const onSubmit = (event) => {
        event.preventDefault();
        props.metodoOnSubmitFormCli({
            nombre,
            apellido,
            fechaNacimiento,
            celular,
            email,
            password,
            domicilio,
            cedula,
        });
    };
    return (
        <div className="body-Register">
            <section className='section-Register'>
                <article className="contenedor-Register">
                    <center>
                        <img
                            className="logoAnimado"
                            src="../Images/Iconos/Logotipo.png"
                            alt="Logotipo"
                            style={{ width: '35%', backgroundColor: '#ffff', borderRadius: '80px' }}
                        />
                    </center>
                    <article className="formulario">
                        <h2>{props.tituloFormCli}</h2>
                        <form onSubmit={onSubmit}>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-user"></i>
                                <input
                                    value={props.nombreCLi}
                                    type="text"
                                    name="nombre"
                                    id="registerName"
                                    pattern="[A-Za-z]+"
                                    maxLength="100"
                                    onKeyPress={(event) => validarSoloLetras(event)}
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setNombre(e.target.value)}
                                    required
                                />
                                <label htmlFor="nombreRegister" className='form-label'>Nombre</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-user"></i>
                                <input
                                    value={props.apellidoCli}
                                    type="text"
                                    name="apellido"
                                    id="registerSurname"
                                    pattern="[A-Za-z]+"
                                    maxLength="100"
                                    onKeyPress={(event) => validarSoloLetras(event)}
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setApellido(e.target.value)}
                                    required
                                />
                                <label htmlFor="apellido">Apellido</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-calendar-alt"></i>
                                <input
                                    value={props.fechaNacimientoCli}
                                    type="date"
                                    name="dateOfBirth"
                                    id="dateOfBirth"
                                    onChange={(e) => setFechaNacimiento(e.target.value)}
                                    required />
                                <label htmlFor="dateOfBirth">Fecha de nacimiento</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-phone"></i>
                                <input
                                    value={props.celularCli}
                                    name="celular"
                                    id="celular"
                                    pattern="[0-9]+"
                                    maxLength="10"
                                    onKeyPress={(event) => validarSoloNumeros(event)}
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setCelular(e.target.value)}
                                    required
                                />
                                <label htmlFor="celular">Celular</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-home"></i>
                                <textarea

                                    cols="35" rows="9" id="direccion" name="domicilio" pattern="[A-Za-z0-9\s\-\.,]+"
                                    className='textArea-Register'
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setDomicilio(e.target.value)}
                                    required >{props.domicilioCli}</textarea>

                                <label htmlFor="domicilio">Domicilio</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-id-card"></i>
                                <input
                                    value={props.cedulaCli}
                                    id="cedula" name="cedula" minlength="10"
                                    pattern="[0-9]{10}"
                                    onkeypress={(e) => validarSoloNumeros(e.event)}
                                    oninput={(e) => validarCedulaInput(e.target)}
                                    onChange={(e) => setCedula(e.target.value)}
                                    required />
                                <p id="mensajeError" style={{ color: 'red' }}></p>

                                <label htmlFor="cedula">Cedula</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-envelope"></i>
                                <input
                                    value={props.emailCli}
                                    type="email"
                                    name="email"
                                    id="emailRegister"
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setEmail(e.target.value)}
                                    required
                                />
                                <label htmlFor="usuario">Email</label>
                            </article>
                            <article className="inputContenedor-Register">
                                <i className="fas fa-lock"></i>
                                <input
                                    value={props.passwordCli}
                                    type="password" name="password" id="passwordRegister"
                                    onInput={(e) => validarCampo(e.target)}
                                    onChange={(e) => setPassword(e.target.value)}
                                    required />
                                <label htmlFor="password">Contraseña</label>
                            </article>

                            <article className="registrar">
                                <input
                                    name="buttonRegister" id="botonEnviar" className='buttonRegister'
                                    type="submit" value={props.buttonNameFormCli} />
                            </article>
                        </form>
                    </article>
                </article>
            </section>
        </div>
    )
}

export default FormCliente
